import styled from 'styled-components';
import Card from '@mui/material/Card';
import { CardMedia } from '@mui/material';

export const StyledCard = styled(Card)`
  margin: auto;
`;

export const StyledCardMedia: any = styled(CardMedia)`
  width: 100%;
  height: 100%;
`;
